import React from "react";
import { connect } from "react-redux";
//const circle = { amount: 8, sign: "radio-button-off" };
const paw = { amount: 1, sign: "paw" };

class CatPath extends React.Component {
  renderList(circle, paw) {
    //const type = circle.amount > 0 ? circle : paw;
    const list = [];
    for (let i = 0; i < circle; i++) {
      list.push(<ion-icon name="paw" key={i} />);
    }
    return list;
  }
  render() {
    return (
      <div>
        ROOF
        <div>
          {this.renderList(0, paw)}
          {this.renderList(this.props.typedHouse, 0)}
        </div>
      </div>
    );
  }
}
const mapStateToProps = state => {
  return { typedHouse: state.typedHouse };
};
export default connect(mapStateToProps)(CatPath);
